    <h1><em>What is <strong> DataScience</strong></em></h1>
    <p><em>Data science is an inter-disciplinary field that uses scientific methods, processes, algorithms and systems to extract knowledge and insights from many structural and unstructured data. Data science is related to data mining, machine learning and big data.</em></p>
